  prdobj.enteryear(data.Year);
  prdobj.clickPurchase();
  prdobj.validateOrder();
  const loadTime = Date.now() - startTime;
  cy.logger('performance', `TotalTime taken to Purchase Product: ${loadTime}ms`);
